import styles from './RoundButton.module.css';

export default function RoundButton(props) {
    

    return (
        <div className={styles.submit_wrapper}>
            <button onClick={this.props.toggleSlide} className={styles.submit} style={{backgroundColor: props.bgcolor, color: props.color}} type={props.type}>{props.value}</button>
        </div>
    )
}
